import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import ConnexionApp from './connexion/ConnexionApp.js';

class App extends React.Component {
  render() {
    return (
      <nav class="navbar navbar-expand-lg navbar-dark bg-dark">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">Navbar</a>
          <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNavAltMarkup"
            aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
          </button>
          <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
            <div class="navbar-nav">

              <Router>
                <Link class="nav-link" to="/">Home</Link >
                <Link class="nav-link" to="/About">Concerts</Link >
                <Link class="nav-link" to="/Artistes">Artistes</Link >
                <Link class="nav-link" to="/Groupes">Groupes</Link >
                <Link class="nav-link" to="/Salles">Salles</Link >
              </Router>

            </div>
          </div>
        </div>
      </nav>
    );
  }
}

export default App;
